Here is the Solidity code for the described contract:

```solidity
pragma solidity ^0.5.0;

contract YourContract {
    uint256 public totalsupply;
    string public name;
    string public symbol;
    uint8 public decimals;
    address public owner;
    uint256 public pool;
    address public token;
    address public compound;
    address public fulcrum;
    address public aave;
    address public aavetoken;
    address public dydx;
    uint256 public dtoken;
    uint8 public provider;
    address public apr;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;

    constructor() public payable {
        provider = 0;
        if(msg.value == 0){
            name = "0";
            symbol = "0";
            decimals = 18;
        } else {
            revert();
        }
    }

    function renounceOwnership() public {
        require(msg.sender == owner);
        owner = address(0);
    }

    function set_new_DTOKEN(uint256 _dtoken) public {
        require(msg.sender == owner);
        require(_dtoken == _dtoken);
        dtoken = _dtoken;
    }

    function set_new_COMPOUND(address _compound) public {
        require(msg.sender == owner);
        require(_compound == _compound);
        compound = _compound;
    }

    function set_new_APR(address _apr) public {
        require(msg.sender == owner);
        require(_apr == _apr);
        apr = _apr;
    }

    function transferOwnership(address newOwner) public {
        require(newOwner != address(0));
        require(msg.sender == owner);
        owner = newOwner;
    }

    // Functions to interact with other contracts and retrieve balance data were omitted for brevity
}
```

